import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import Header from './Header';
import history from './history';

class Plainte extends Component {

    render() {
      return (
          <div>
<form>
               <fieldset>
                 <legend>Exemple de formulaire Bootstrap</legend>

                 <div class="form-group">
                   <label for="nom">Entrez votre nom</label>
                   <input type="text" class="form-control" id="nom" placeholder="Pierre GIRAUD"> </input>
                 </div>

                 <div class="form-group">
                   <label for="email">Entrez votre mail</label>
                   <input type="email" class="form-control" id="email" placeholder="pierre.giraud@edhec.com"> </input>
                 </div>

                 <div class="form-group">
                   <label for="bio">Biographie</label>
                   <textarea class="form-control" id="bio" rows="3"></textarea>
                 </div>
               </fieldset>
             </form>
           </div>



      );
    }

  }


export default Plainte;
